class StockPrice {
private: multiset<int> count; unordered_map<int, int> rec; int now; public: StockPrice() {} void update(int timestamp, int price) { auto it = rec.find(timestamp); if (it != rec.end()) { count.erase(count.find(it->second)); } count.insert(price); rec[timestamp] = price; now = max(now, timestamp); } int current() { return rec[now]; } int maximum() { return *count.rbegin(); } int minimum() { return *count.begin(); }
};

